import React from 'react';
import { Link } from 'react-router-dom';

const guilds = [
  { id: 1, name: 'Guild 1', channels: [{ id: 'animals', name: 'Animals' }, { id: 'cats', name: 'Cats' }] },
  { id: 2, name: 'Guild 2', channels: [{ id: 'dogs', name: 'Dogs' }, { id: 'birds', name: 'Birds' }] }
];

const GuildView = () => {
  return (
    <div className="flex h-screen">
      {/* Guild List */}
      <div className="w-1/4 bg-gray-900 text-white">
        <h1 className="text-xl p-4">Guilds</h1>
        <ul>
          {guilds.map(guild => (
            <li key={guild.id} className="p-2">
              <span className="font-bold">{guild.name}</span>
              <ul className="ml-4">
                {guild.channels.map(channel => (
                  <li key={channel.id}>
                    <Link to={`/guild/${guild.id}/channel/${channel.id}`} className="text-blue-400 hover:underline">
                      {channel.name}
                    </Link>
                  </li>
                ))}
              </ul>
            </li>
          ))}
        </ul>
      </div>

      {/* Placeholder */}
      <div className="flex-1 bg-gray-800 text-white flex items-center justify-center">
        <h2 className="text-3xl">Select a guild and channel</h2>
      </div>
    </div>
  );
};

export default GuildView;
